data: str = ''
ALPHABET: str = 'abcdefghijklmnopqrstuvwxyz'
reacting_units: set = set()

for count in range(0, len(ALPHABET)): # create reacting units
    reacting_units.add((ALPHABET[count].upper())+(ALPHABET[count].lower())) # adds 'Aa' or other to set
    reacting_units.add((ALPHABET[count].lower())+(ALPHABET[count].upper())) # adds 'aA' or other to set

def delete_units(polymer: str):
    current_line: str = ''
    reduced_polymer: str = '' # polymer without destroyed units
    count: int = 0
    while polymer != current_line:
        count = 0
        while count < len(polymer) - 1:
            current_pair = polymer[count]+polymer[count+1]
            if current_pair in reacting_units:  # compare current pair of letters with set of reacting units
                current_line = polymer.replace(current_pair, '')
                count = 0  # start again at the beginning of line
                polymer = current_line
            else:
                count += 1
    reduced_polymer = polymer

    return reduced_polymer


# ---------- PART ONE ----------

print('Starting part one...\r')
print('Polymer: ', data)
print('Final polymer: ', delete_units(data))
print('Length of final polymer: ', len(delete_units(data)))
print('\r')


# ---------- PART TWO ----------

print('Starting part two...\r')

minimum_length: int = 0
new_polymer: str = ''
best_polymer: str = ''

minimum_length = len(data)
for letters in range(0, len(ALPHABET)):
    new_polymer = data
    new_polymer = new_polymer.replace(ALPHABET[letters], '') # delete lowercase letters
    new_polymer = new_polymer.replace(ALPHABET[letters].upper(), '') # delete uppercase letters
    print('Letters deleted in polymer: ', ALPHABET[letters], ALPHABET[letters].upper())
    delete_units(new_polymer)
    if len(delete_units(new_polymer)) < minimum_length:
        minimum_length = len(delete_units(new_polymer))
        print('New minimum: ', minimum_length)
        best_polymer = delete_units(new_polymer)

print('\r')
print('Best polymer: ', best_polymer)
print('Minimum length: ', minimum_length)

